import './index.css';
import React from "react"
import ReactDOM from 'react-dom';
import AddButton from './AddButton';
import Headings from './Headings';


ReactDOM.render(
    <div>
      <Headings/>
      <div class="flex">
        <div class="button"><AddButton /></div>
      </div>
    </div>,
    document.getElementById('root')
);
